import React from "react";

type SlideProps = {
  numberSlide: number;
  setNumberSlide: (number: number) => void;
};

const MyWayPage: React.FC<SlideProps> = ({ numberSlide, setNumberSlide }) => {
  return (
    <>
      <div className="slider-container header px-4 w-[100%]">
        <div className="wrapper">
          <h2 className="text-5xl my-8 text-center greeting font-medium ">
            My Way
          </h2>
        </div>
        <div className="icons">
            <div className="icon">
              <button
                className="hero-button px-2 py-2 rounded"
                onClick={() => setNumberSlide(4)}
              >
                <i className="fa-solid fa-arrow-left"></i>&nbsp;H
              </button>
            </div>
            <div className="icon">
              <button
                className="hero-button px-2 py-2 rounded"
                onClick={() => setNumberSlide(2)}
              >
                My Way in Germany &nbsp;<i className="fa-solid fa-arrow-right"></i>
              </button>
            </div>
          </div>
      </div>
    </>
  );
};

export default MyWayPage;
